import React, { Component } from 'react'
import './ContentBar.css'
import { Gapped,Button } from '@skbkontur/react-ui';

interface Props{

}

interface State{

}

class ContentBar extends Component<Props,State>{
    constructor(props : Props){
        super(props);
        this.state={}
    }

    private renderContentBar(){
        return(
            <div className='contentBar'>
                <Gapped>
                    <Button use="default">Default</Button>
                    <Button use="primary">Primary</Button>
                    <Button use="success">Success</Button>
                    <Button use="danger">Danger</Button>
                    <Button use="pay">Pay</Button>
                    <Button use="link">Link</Button>
                </Gapped>>
            </div>
        )
    }

    render(){
        return this.renderContentBar();
    }
}

export default ContentBar
